  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Edwin
  B. Forsythe National Wildlife Refuge- Brigantine Division outlines Refuge accomplishments
  during the 1987 calendar year. The report begins with a summary of the year's highlights
  and weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses the master plan, management planning, public participation,
  compliance with environmental and cultural resource mandates, and research and investigations.
  Refuge administration is outlined; information about volunteer programs, funding,
  and safety is given. Habitat management is also covered; subjects include wetlands,
  fire management, pest control, water rights, wilderness areas, and WPA easements.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, waterfowl, shorebirds, raptors, animal control, marking and
  bird banding, and disease control. The public uses of the Refuge described in this
  report include outdoor classrooms, interpretive programs, hunting, fishing, trapping,
  wildlife observation, outdoor recreation, and law enforcement. The equipment and
  facilities section of the report provides information about new construction, rehabilitation,
  equipment replacement, communication systems, and computer systems. Cooperative
  programs and items of interest are provided at the end. Refuge brochures and field
  guides are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
